import logo from './logo.svg';
import './App.css';

function App() {
  const monTableau = ["item1", "item2"];
  return <ul>
    {
      monTableau.map(item => <li>{item}</li>)
    }
  </ul>


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
